import { useEffect } from "react";
import { Block } from "@material-ui/icons";
import "./Card.css";
import imgs from "./data";
import "./Offer.css";
const Card = (property) => {
  const index = property.property;
  const p = imgs.properties[index];
  const picture = p.picture;
  const f = p.index;
  useEffect(() => {
    return (
      <div
        id={"card-${index}"}
        className="card animateimage"
        onAnimationEnd={property.animat}
      >
        <img src={picture} className="image"></img>
      </div>
    );
  }, [f]);
};
export default Card;
